package leetcode

import (
	"testing"
)

type question struct {
	para
	ans
}

type para struct {
	s string
	t string
}

type ans struct {
	one string
}

func TestMinWindow(t *testing.T) {

	qs := []question{

		question{
			para{
				"",
				"",
			},
			ans{
				"",
			},
		},

		question{
			para{
				"a0bc00a",
				"abc",
			},
			ans{
				"a0bc",
			},
		},

		question{
			para{
				"abcdabcdabcd",
				"aaa",
			},
			ans{
				"abcdabcda",
			},
		},

		question{
			para{
				"abc",
				"aa",
			},
			ans{
				"",
			},
		},

		question{
			para{
				"a",
				"aa",
			},
			ans{
				"",
			},
		},

		question{
			para{
				"ADOBECODEBANC",
				"ABC",
			},
			ans{
				"BANC",
			},
		},

		question{
			para{
				"ADOBECODEBANC",
				"ABCZ",
			},
			ans{
				"",
			},
		},

		// 如需多个测试，可以复制上方元素。
	}

	for _, q := range qs {
		expect, p := q.ans, q.para

		res := minWindow(p.s, p.t)
		if res == expect.one {
			t.Logf("The minwindow in %s is %s, which contains all chars in %s", p.s, res, p.t)
		} else {
			t.Fatalf("Expect %s, but %s given", expect.one, res)
		}

	}

}
